import React from "react";
import "../slider.css";
import { Navbar, Container } from "react-bootstrap";

const Products = () => {
  return (
    <>
       <Container>
           <row>
               <div className="col-12">
                   <h1 className="text-center">Shop Products</h1>
               </div>
           </row>
       </Container>
    </>
  );
};

export default Products;
